import "./Message.scss"

const MessageItem=(props)=>{
  let path="/dialogs/"+props.id;
  return(
    <li>{props.message}</li>
  );
}

const Message=()=>{
  let MessagesData=[
    {id:1,message:"здарова чепушня"},
    {id:2,message:"здарова качеля"},
  ]
    let MessagesElements=MessagesData.map(message=><MessageItem message={message.message}></MessageItem>)
    return(
        <div className="Message">
        <ul>
        <li>img</li>
        <li>img</li>
        </ul>
        <ul>
          {MessagesElements}
          {MessagesElements}
        </ul>
        </div>
    );
}

export default Message
